import React from 'react';
import ReactDOM from 'react-dom';
import { AppoloProvider } from 'react-apollo';
import App from './App';


ReactDOM.render(
    <AppoloProvider client={new AppoloClient()}>
        <App/>
    </AppoloProvider>
    , document.getElementById('root'));
